import React from 'react';
import Beer from './beer';
import ChristianDrinking from '../../images/team/ChristianDrinking.jpg';

const HeaderSection = () => {
  const style = {
    boxShadow: "0 10px 20px 0 rgba(10, 10, 10, 0.63)",
    height: "300px",
    borderRadius: "50%",
    width: "300px",
  }
  return(
      <div className="row">
        <div className="col">
        </div>
        <div className="col">
          <img src={ChristianDrinking} style={style}/>
        </div>
      </div>
  )
}

export default HeaderSection;
